var render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('div',{staticClass:"content"},[_vm._ssrNode("<h1 id=\"fish\"><a href=\"#fish\" aria-hidden=\"true\" class=\"header-anchor\">#</a> Fish</h1> <p>烟裕华凭借多年的从业经验，对货源地产品认真栓选，确保一流品质\n<img src=\"yuhua-demo-p.svg\"></p><div style=\"padding:56.25% 0 0 0;position:relative;\"><iframe src=\"https://player.vimeo.com/video/283261323?loop=0&title=0&byline=0&portrait=0\" frameborder=\"0\" webkitallowfullscreen mozallowfullscreen allowfullscreen=\"allowfullscreen\" style=\"position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p></p> <p>极致的匠心精神，原料选自最好的原产地，在最佳的季节进行捕捞，确保顶级的产品质量</p> <h2 id=\"_1-pacific-mackerel\"><a href=\"#_1-pacific-mackerel\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 1.Pacific Mackerel</h2> <p><strong>主要采购国家：</strong> 韩国、日本</p> <p><strong>规格：</strong>200-400 300-500，400-600 700+</p> <p><strong>包装：</strong>10公斤或15公斤</p> <div class=\"imgb\"><img src=\"http://pd255kmag.bkt.clouddn.com/%E9%B2%90%E9%B2%85%E9%B1%BC--Pacific%20Mackerel.jpg?\t\nimageView2/0/interlace/1/q/30|imageslim\"></div> <br> <br> <br> "),_vm._ssrNode("<h2 id=\"_2-spanish-mackerel\">","</h2>",[_vm._ssrNode("<a href=\"#_2-spanish-mackerel\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 2. Spanish Mackerel "),_c('Badge',{attrs:{"text":"畅销","type":"error"}})],2),_vm._ssrNode(" <p><strong>主要采购国家：</strong> 韩国、日本</p> <p><strong>规格：</strong>200-400 300-400 500-750</p> <p><strong>包装：</strong>10公斤或15公斤</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/Spanish%20Mackerel%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Spanish%20Mackerel%20%283%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Spanish%20Mackerel%20%282%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Spanish%20Mackerel%20%284%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <br> <br> <br> <h2 id=\"_3-plaice\"><a href=\"#_3-plaice\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 3. Plaice</h2> <p><strong>主要采购国家：</strong> 日本、韩国、台湾</p> <p><strong>规格：</strong>100-200，200-300，300-500</p> <p><strong>包装：</strong>10公斤或15公斤</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/PLAICE%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/PLAICE%20%283%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/PLAICE%20%284%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/PLAICE%20%281%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <br> <br> <br> <h2 id=\"_4-yellowtail\"><a href=\"#_4-yellowtail\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 4. Yellowtail</h2> <p><strong>主要采购国家：</strong>日本</p> <p><strong>规格：</strong>2500+</p> <p><strong>包装：</strong>不定重，2-3条/箱</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/2Yellowtail%20%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Yellowtail%20%281%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Yellowtail%20%282%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Yellowtail%20%286%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Yellowtail%20%284%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Yellowtail%20%285%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <br> <br> <br> <h2 id=\"_5-ribbonfish\"><a href=\"#_5-ribbonfish\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 5. Ribbonfish</h2> <p><strong>主要采购国家：</strong> 韩国、日本、南美洲、巴西、巴基斯坦、非洲、中东</p> <p><strong>规格：</strong>100-200，200-300，700-1000</p> <p><strong>包装：</strong>10公斤或15公斤</p> <figure class=\"third\"><img src=\"http://oygtyapwc.bkt.clouddn.com/%E5%B8%A6%E9%B1%BC.jpeg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://oygtyapwc.bkt.clouddn.com/%E5%B8%A6%E9%B1%BC2.jpeg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://oygtyapwc.bkt.clouddn.com/%E5%B8%A6%E9%B1%BC3.jpeg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/daiyu4.jpeg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <br> <br> <br> <h2 id=\"_6-scad\"><a href=\"#_6-scad\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 6. Scad</h2> <p><strong>主要采购国家：</strong>日本、韩国</p> <p><strong>规格：</strong>100-200</p> <p><strong>包装：</strong>10公斤</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/Scad%20%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Scad%20%281%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Scad%20%282%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Scad%20%283%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <h2 id=\"_7-mullet\"><a href=\"#_7-mullet\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 7. Mullet</h2> <h2 id=\"_8-saury\"><a href=\"#_8-saury\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 8. Saury</h2> <p><strong>主要采购国家：</strong> 日本、韩国、台湾</p> <p><strong>规格：</strong>1号：130-150g/2号:110-130g\n3号:90-110g/4号:90g</p> <p><strong>包装：</strong>10公斤或15公斤</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/Saury%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Saury%20%282%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Saury%20%281%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Saury%20%284%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <h2 id=\"_9-sardine\"><a href=\"#_9-sardine\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 9. Sardine</h2> <h2 id=\"_10-rubio\"><a href=\"#_10-rubio\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 10. Rubio</h2> <p><strong>主要采购国家：</strong>乌拉圭</p> <p><strong>规格：</strong>M,L</p> <p><strong>包装：</strong>10公斤或15公斤/箱</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/2Herring%20%282%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Herring%20%281%29.png?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Herring%20%283%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/2Herring%20%285%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <h2 id=\"_11-ray\"><a href=\"#_11-ray\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 11. Ray</h2> <p><strong>主要采购国家：</strong> 韩国、日本、东南亚、非洲</p> <p><strong>规格：</strong>200-300</p> <p><strong>包装：</strong>10公斤</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/ray%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/ray%20%281%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/ray%20%282%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/ray%20%283%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/ray%20%284%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/ray%20%285%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <h2 id=\"_12-herrying\"><a href=\"#_12-herrying\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 12. Herrying</h2> <p><strong>主要采购国家：</strong>韩国、俄罗斯</p> <p><strong>规格：</strong>100-200，200-300</p> <p><strong>包装：</strong>10公斤</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/Herring%20%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Herring%20%282%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Herring%20%283%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Herring%20%285%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <h2 id=\"_13-capelin\"><a href=\"#_13-capelin\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 13. Capelin</h2> <p><strong>主要采购国家：</strong>加拿大、冰岛、挪威</p> <p><strong>规格：</strong>4l，5l，6l</p> <p><strong>包装：</strong>10公斤</p> <figure class=\"third\"><img src=\"http://p93s97xb4.bkt.clouddn.com/Capelin%E6%8B%B7%E8%B4%9D.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Capelin%20%283%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Capelin%20%281%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"> <img src=\"http://p93s97xb4.bkt.clouddn.com/Capelin%20%284%29.jpg?imageView2/1/w/300/h/300/q/75|imageslim\"></figure> <hr> <h2 id=\"_14-sea-bream\"><a href=\"#_14-sea-bream\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 14. Sea bream</h2> <h2 id=\"_15-sand-launce\"><a href=\"#_15-sand-launce\" aria-hidden=\"true\" class=\"header-anchor\">#</a> 15. Sand Launce</h2>")],2)}
